export const About = () => {
  return (
    <div  name='home' className='w-full h-screen bg-[black]'> 
        <div className='flex flex-col justify-center items-center w-full h-full' >
            <h1 className=' inline ' >About</h1>
        </div>
    </div>
  )
}
